<H1><A NAME="c2995"></A><SUP></SUP>Compiler Error C2995</H1>

<P class=dt><B>'identifier' : template function has already been defined</B></P>

<P>The template function <I>identifier</I> has been previously defined. Make sure that there is only one member function definition for each member function of a templated class.</P>
